// Navbar.jsx
import React from 'react';
import '../styles/Navbar.css'; // Impor file CSS untuk Navbar

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul>
        <li>Home</li>
        <li>Inbox</li>
        <li>Sent</li>
        {/* Tambahkan opsi menu lainnya sesuai kebutuhan */}
      </ul>
    </nav>
  );
};

export default Navbar;
